/* * To change this license header, choose License Headers in Project Properties. * To change this template file, choose Tools | Templates * and open the template in the editor. */package model.Domain.TipoQuestionario;import model.Domain.TipoPergunta.TipoPerguntaDomain;import model.Domain.RespostaQuestionario.RespostaQuestionario;import java.util.List;/** * * @author carli */public class TipoQuestionarioDomain {    private int id;    private String nome;    private String descricao;    private int tipo_pergunta_id;    private String tipo_pergunta;    private String tipo_resposta;    public TipoQuestionarioDomain() {}    public TipoQuestionarioDomain(int id, String nome, String descricao, int tipo_pergunta_id, String tipo_pergunta, String tipo_resposta) {        this.id = id;        this.nome = nome;        this.descricao = descricao;        this.tipo_pergunta_id = tipo_pergunta_id;        this.tipo_pergunta = tipo_pergunta;        this.tipo_resposta = tipo_resposta;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getNome() {        return nome;    }    public void setNome(String nome) {        this.nome = nome;    }    public String getDescricao() {        return descricao;    }    public void setDescricao(String descricao) {        this.descricao = descricao;    }    public String getTipo_pergunta() {        return tipo_pergunta;    }    public void setTipo_pergunta(String tipo_pergunta) {        this.tipo_pergunta = tipo_pergunta;    }    public String getTipo_resposta() {        return tipo_resposta;    }    public void setTipo_resposta(String tipo_resposta) {        this.tipo_resposta = tipo_resposta;    }    public int getTipo_pergunta_id() {        return tipo_pergunta_id;    }    public void setTipo_pergunta_id(int tipo_pergunta_id) {        this.tipo_pergunta_id = tipo_pergunta_id;    }}